import { Button } from 'semantic-ui-react'
import React from 'react'
import Link from 'next/link'

function images() {
 return (
     <div>
         <Button
    content="Choose File"
    labelPosition="left"
    icon="file"
    onClick={() => this.fileInputRef.current.click()}
  />
  <input
    ref={this.fileInputRef}
    type="file"
    hidden
    onChange={this.fileChange}
  />
     </div>
 )


} export default images;
